				CBIstr +=
						GetWord(183) +
						"[" +
						GetWord(179) +
						"]" +
						GetWord(181) +
						wIS +
						bonusValue +
						"%<br/>";
		if (27 <= bonusType && bonusType <= 29)
				// Size Dmg
				CBIstr +=
						GetWord(183) +
						"[" +
						SizeOBJ[bonusType - 27][Language] +
						"]" +
						GetWord(180) +
						wIS +
						bonusValue +
						"%<br/>";
